import React from 'react';
import './Carousel.css';

import pic1 from '../assets/frontend_assets/animonda.png';
import pic2 from '../assets/frontend_assets/bioline.png';
import pic3 from '../assets/frontend_assets/classic_pets.png';
import pic4 from '../assets/frontend_assets/petkin.png';


const Carousel = () => {
    return (
        <div className='carousel'>
            <div className="logos">
                <img src={pic1} alt="" />
                <img src={pic2} alt="" />
                <img src={pic3} alt="" />
                <img src={pic4} alt="" />
                <img src={pic1} alt="" />
                <img src={pic2} alt="" />
                <img src={pic3} alt="" />
                <img src={pic4} alt="" />
                <img src={pic1} alt="" />
                <img src={pic2} alt="" />
                <img src={pic3} alt="" />
                <img src={pic4} alt="" />
                <img src={pic1} alt="" />
                <img src={pic2} alt="" />
                <img src={pic3} alt="" />
                <img src={pic4} alt="" />
            </div>
            <script>
                var copy = document.querySelector(".logos").cloneNode(true);
                document.querySelector(".carousel")
            </script>
        </div>
    );
};

export default Carousel;
